# WEEK 1
def pattern_count(text, pattern):
    """ Takes in a dna sequence, text (string), and a pattern (string)  and counts the number of times the pattern
    occurs in the dna sequence """

    count = 0
    len_text = len(text)
    len_pattern = len(pattern)
    for i in range(len_text - len_pattern):
        if pattern in text[i:i + len_pattern]:
            count = count + 1
        else:
            continue
    return count


def frequency_table(text, k):
    """ Helper function for frequent_words() and find_clumps() that counts how many times a pattern k occurs in a
    text """

    freq_map = {}
    len_text = len(text)
    for i in range(len_text - k + 1):
        pattern = text[i:i + k]
        if pattern not in freq_map:
            freq_map[pattern] = 1
        else:
            freq_map[pattern] = freq_map[pattern] + 1
    return freq_map


def max_map(freq_map):
    """ Takes in a frequency map, freq_map (dict) and returns the number of occurrences associated with the most
    frequent k-mer """

    max_val = max(freq_map.values())
    return max_val


def frequent_words(text, k):
    """ Given a sequence of bases, text (list), and an integer k, find the most frequent k-mers in the sequence """

    frequent_patterns = []
    freq_map = frequency_table(text, k)
    max_val = max_map(freq_map)
    for key in freq_map.keys():
        if freq_map[key] == max_val:
            frequent_patterns.append(key)
    return frequent_patterns


def reverse_complement(pattern):
    """ Takes in a pattern (string) and returns the reverse complement of a given DNA sequence """

    complement = ''
    for i in range(len(pattern)):
        if pattern[i] == 'A':
            complement = complement + 'T'
        elif pattern[i] == 'T':
            complement = complement + 'A'
        elif pattern[i] == 'C':
            complement = complement + 'G'
        else:
            complement = complement + 'C'
    rev_complement = list(reversed(complement))
    return ''.join(rev_complement)


def find_clumps(text, k, len_win, t):
    """ A clump is defined as a repeating sequence of length k, that repeats at least t times in a size len_win
    window """

    patterns = []
    len_text = len(text)
    for i in range(len_text - len_win + 1):
        window = text[i:i + len_win]
        freq_map = frequency_table(window, k)
        for key in freq_map.keys():
            if freq_map[key] >= t and key not in patterns:
                patterns.append(key)
    return patterns


# WEEK 2
def calculate_skews(genome):
    """ The skew represents the difference between the number of G nucleotides and C nucleotides in a genome. This
    can be used to determine an origin of replication. As the origin of replication is crossed, the trend in (G - C)
    shifts from decreasing to increasing. In other words, the origin of replication can be indicated by a minimum on
    the graph displaying the skew. """

    skew = 0
    skew_list = [0]

    for base in genome:
        if base == 'G':
            skew = skew + 1
        elif base == 'C':
            skew = skew - 1
        skew_list.append(skew)
    return skew_list


def get_minimum_skew(skews):
    return min(skews)


def compute_hamming_distance(str1, str2):
    """ Hamming Distance is the number of mismatches between two genomes """

    mismatches = 0
    len_strs = len(str1)
    for i in range(len_strs):
        if str1[i] != str2[i]:
            mismatches = mismatches + 1
    return mismatches


def approximate_pattern_match(pattern, text, max_mismatches):
    pos = []
    for i in range(len(text) - len(pattern) + 1):
        mismatches = compute_hamming_distance(pattern, text[i:i + len(pattern)])
        if mismatches <= max_mismatches:
            pos.append(i)
    return pos


def approximate_pattern_count(pattern, text, max_mismatches):
    pos = approximate_pattern_match(pattern, text, max_mismatches)
    return len(pos)


def neighbors(pattern, d):
    """ The neighbors for a pattern are the strings that match the given pattern with at most d mismatches """

    if d == 0:
        return [pattern]
    if len(pattern) == 1:
        return ['A', 'C', 'G', 'T']
    neighborhood = []
    suffix_pattern = pattern[1:]
    suffix_neighbors = neighbors(suffix_pattern, d)
    for text in suffix_neighbors:
        hdist = compute_hamming_distance(suffix_pattern, text)
        if hdist < d:
            for n in ['A', 'C', 'G', 'T']:
                neighbor = n + text
                neighborhood.append(neighbor)
        else:
            neighbor = pattern[0] + text
            neighborhood.append(neighbor)
    return neighborhood


def frequent_words_with_mismatches(text, k, d):
    """ This is like frequent_words but it tolerates d mismatches when finding the number of matches for a given
    substring pattern and its reverse complement """

    patterns = []
    freq_map = {}
    n = len(text)
    for i in range(n - k + 1):
        pattern = text[i:i + k]
        pattern_rc = reverse_complement(pattern)
        neighborhood = neighbors(pattern, d) + neighbors(pattern_rc, d)
        for j in range(len(neighborhood)):
            neighbor = neighborhood[j]
            if neighbor not in freq_map.keys():
                freq_map[neighbor] = 1
            else:
                freq_map[neighbor] = freq_map[neighbor] + 1
    m = max_map(freq_map)
    for key in freq_map.keys():
        if freq_map[key] == m:
            patterns.append(key)
    return patterns


# WEEK 3
def motif_enumeration(dna, k, d):
    """ Finds all k-mers in the collections of strings, dna, that are at most d mismatches from all other k-mers in
    dna """

    patterns = []
    neighborhoods = []
    for dna_string in dna:
        len_dna_string = len(dna_string)
        neighborhood = []
        for i in range(len_dna_string - k + 1):
            pattern = dna_string[i:i + k]
            dna_neighbors = neighbors(pattern, d)
            neighborhood = neighborhood + dna_neighbors
        neighborhoods.append(neighborhood)
    for n in neighborhoods[0]:
        count = 0
        for i in range(1, len(neighborhoods)):
            if n in neighborhoods[i]:
                count = count + 1
        if count == len(neighborhoods) - 1 and n not in patterns:
            patterns.append(n)
    return patterns


def count_nucleotides(mat):
    """ Takes a motif matrix (ndarray) in as argument and outputs an ndarray where each element is a count of A, G,
    C, or T in the given column """

    final_counts = np.ones((4, mat.shape[1]))

    for i in range(len(mat[0, :])):
        cur_nucleotides = np.ones((4, 1))
        a_count = 0
        c_count = 0
        g_count = 0
        t_count = 0
        for j in range(len(mat[:, 0])):
            if mat[j, i] == 'A':
                a_count = a_count + 1
            elif mat[j, i] == 'C':
                c_count = c_count + 1
            elif mat[j, i] == 'G':
                g_count = g_count + 1
            elif mat[j, i] == 'T':
                t_count = t_count + 1
        cur_nucleotides = np.array([a_count, c_count, g_count, t_count])
        final_counts[:, i] = cur_nucleotides
    return final_counts


def profile(c_mat, mat_rows):
    """ Takes in a count motif matrix (ndarray), and number of rows in the original motif matrix (ndarray) and
    outputs the profile matrix (ndarray). The profile matrix is simply the probability distribution matrix """

    profile_mat = c_mat / mat_rows

    return profile_mat


def compute_entropy(mat):
    """ The entropy of a motif matrix (ndarray) is the sum of the entropies of its columns
    Minimum entropy for a column is 0 and this indicates perfect conservation of nucleotides in that column """

    total_entropy = 0

    count_motifs = count_nucleotides(mat)
    p = profile(count_motifs, mat.shape[0])

    for i in range(len(p[0, :])):
        entropy = 0
        for j in range(len(p[:, 0])):
            if p[j, i] != 0:
                entropy = entropy + p[j, i] * math.log(p[j, i], 2)
        total_entropy = total_entropy - entropy

    return total_entropy


def generate_kmers(k):
    """ Takes in an integer and generates all possible kmers of A, C, G, T """

    kmers_list = []
    kmers_tuples = itertools.product('ACGT', repeat=k)
    for kmer in kmers_tuples:
        kmers_list.append(''.join(kmer))

    return kmers_list


def distance_between_pattern_and_strings(pattern, dna):
    """ Computes the sum of the (min) distances between pattern and dna """

    k = len(pattern)
    distance = 0

    for text in dna:
        hamming_distance = 1000000
        for i in range(len(text) - k + 1):
            if hamming_distance > compute_hamming_distance(pattern, text[i:i + k]):
                hamming_distance = compute_hamming_distance(pattern, text[i:i + k])
        distance = distance + hamming_distance
    return distance


def median_string(k, dna):
    """ Takes in an integer value to be the length of the kmer, and a collection of strings, dna, and outputs the
    kmer that minimizes the distance between kmer and each dna string for all possible choices of kmers """

    kmers = generate_kmers(k)

    distance = 1000000
    median = ''
    for pattern in kmers:
        cur_distance = distance_between_pattern_and_strings(pattern, dna)
        if distance > cur_distance:
            distance = cur_distance
            median = pattern

    return median


def compute_probability(pattern, profile):
    """ Takes in a pattern and a profile matrix (ndarray) and returns the probability of the pattern """

    nucs = {'A': 0, 'C': 1, 'G': 2, 'T': 3}
    prob = 1

    for i in range(len(pattern)):
        nuc = pattern[i]
        prob = prob * profile[nucs[nuc], i]

    return prob


def profile_most_probable_kmer(text, k, profile):
    """ Takes in a dna sequence, text, an integer, k, and a probability matrix (ndarray), profile, and outputs the
    kmer within text that has the highest probability """

    highest_prob = 0
    mpk = np.zeros(k, dtype='str')
    for i in range(len(text) - k + 1):
        pattern = text[i:i + k]
        cur_prob = compute_probability(pattern, profile)
        if cur_prob > highest_prob:
            highest_prob = cur_prob
            mpk = pattern

    return mpk


def score_motif(motifs):
    """ Takes in a motifs matrix (ndarray) and computes the score. The score is The score is given by taking all of
    the non-conserved nucleotides in each column of the motif matrix and summing all of the sums from each column.
    The lower the score the more conserved the collection of motifs """

    score = 0
    count_matrix = count_nucleotides(motifs)
    for i in range(len(count_matrix[0, :])):
        col = count_matrix[:, i]
        max_count = np.max(col)
        col_score = np.sum(col) - max_count
        score = score + col_score
    return score


def greedy_motif_search(dna, k, t):
    """ Takes in a collection of dna strings (an ndarray), an integer k, and the number of rows in the dna
    collection, t, and outputs a collections of the best motifs which are the motifs that, together, contribute to
    the best possible score. (see function score_motif() to see how the score is calculated.) """

    first_kmers_in_dna = dna[:, 0:k]
    best_motifs = first_kmers_in_dna.copy()
    dna_first_string = dna[0, :]

    for j in range(len(dna_first_string) - k + 1):
        motifs = np.zeros((t, k), dtype='str')
        motifs[0, :] = dna[0, j:j + k]
        for i in range(1, t):
            count_mat = count_nucleotides(motifs)
            profile_mat = profile(count_mat + 1, i + 4)  # using pseudocounts
            pattern = dna[i, :]
            mpk = profile_most_probable_kmer(pattern, k, profile_mat)
            if not mpk[0]:
                motifs[i, :] = dna[i, 0:k]
            else:
                motifs[i, :] = mpk
        if score_motif(motifs) < score_motif(best_motifs):
            best_motifs = motifs
    return best_motifs


# WEEK 4
def random_kmers(k, t, dna):
    """ Helper function for randomized motif search and gibbs sampler. Takes in k (length of kmer), t (number of rows
    in dna collection), and dna (ndarray) and outputs a matrix (ndarray) of randomly selected kmers in the dna
    collection """

    motifs = np.zeros((t, k), dtype='str')
    for i in range(t):
        random_kmer_index = random.randrange(len(dna[0, :]) - k)
        current_seq = dna[i, :]
        motifs[i, :] = list(current_seq[random_kmer_index: random_kmer_index + k])

    return motifs


def randomized_motif_search(k, t, dna):
    """ Takes in an integer k (length of kmer), t (number of lines in dna collection), and dna (ndarray)) and outputs
    a collection of BestMotifs generated by running randomized_motif_search() 1000 times """

    # randomly select kmer from each sequence in dna ndarray
    motifs = np.zeros((t, k), dtype='str')
    for i in range(t):
        random_kmer_index = random.randrange(len(dna[0, :]) - k)
        current_seq = dna[i, :]
        motifs[i, :] = list(current_seq[random_kmer_index: random_kmer_index + k])
    best_motifs = motifs.copy()

    # generate a profile for the random kmers motif matrix and create a matrix of most-probable kmers based on that
    # profile
    mpks = np.zeros((t, k), dtype='str')
    while True:
        count_mat = count_nucleotides(motifs)
        prof_mat = profile(count_mat + 1, motifs.shape[0] + 4)  # using pseudocounts

        for i in range(t):
            mpk = profile_most_probable_kmer(dna[i, :], k, prof_mat)
            mpks[i, :] = mpk

        if score_motif(mpks) < score_motif(best_motifs):
            best_motifs = mpks.copy()
            motifs = mpks.copy()
        else:
            return best_motifs, score_motif(best_motifs)


def gibbs_sampler(dna, k, t, N):
    """ Takes in a dna matrix (ndarray), k, t, and N (integer representing number of iterations) and outputs a
    collection of the best scoring motifs """

    motifs = random_kmers(k, t, dna)
    best_motifs = motifs.copy()

    for j in range(N):
        random_dna_seq_index = random.randrange(t)
        random_dna_seq = dna[random_dna_seq_index, :]
        mask = np.ones(t, dtype=bool)
        mask[random_dna_seq_index] = False

        count_mat = count_nucleotides(motifs[mask, :])
        prof_mat = profile(count_mat + 1, t - 1 + 4)

        mpk = profile_most_probable_kmer(random_dna_seq, k, prof_mat)
        motifs[random_dna_seq_index, :] = mpk

        if score_motif(motifs) < score_motif(best_motifs):
            best_motifs = motifs.copy()

    return best_motifs, score_motif(best_motifs)


